import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import AuthContextProvider from './contexts/AuthContext';
import Navbar from "./Navbar";
import Login from "./Loginogin";
import Home from "./Home";
import About from "./About";
import Services from "./Services";
import MEDICONNECTChatbot from "./Chatbot"; 
import Preloader from "./Preloader"; 
import PhoneSignin from "./firebase/PhoneSignin";
import VideoRecommendations from './components/VideoRecommendations';




function App() {
  const [loading, setLoading] = useState(true);
  const [symptom, setSymptom] = useState("fever"); 

  useEffect(() => {
    const timer = setTimeout(() => {
      setLoading(false);
    }, 5000); 
    return () => clearTimeout(timer);
  }, []);

  return (
    <AuthContextProvider>
      <Router>
        {loading ? (
          <Preloader />
        ) : (
          <div>
            <Navbar />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/about" element={<About />} />
              <Route path="/services" element={<Services />} />
              <Route path="/chatbot" element={<MEDICONNECTChatbot />} />
              <Route path="/signin" element={<PhoneSignin />} />
            </Routes>

            {/* Example usage of VideoRecommendations component */}
            {/* <div className="video-recommendations-section">
              <h2>Recommended Videos for Medical Symptoms</h2>
              <VideoRecommendations symptom={symptom} />
            </div> */}
          </div>
        )}
      </Router>
    </AuthContextProvider>
  );
}

export default App;
